import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.scss';
import UserContext from '../UserContext';

const Navbar = () => {

    const { isLoggedIn, profile } = useContext(UserContext);

    const navOnline = isLoggedIn ? (
        <button onClick={() => { window.location.replace('http://localhost:3001/auth/logout') }} className="button google-btn">
            Logout
            </button>
    ) : (
            <button onClick={() => { window.location.replace('http://localhost:3001/auth/google') }} className="button google-btn">
                Signin with Google+
                            </button>
        )

    return (
        <nav className="navbar is-fullheight-with-navbar" role="navigation" aria-label="main navigation">

            <div id="navbarBasicExample" className="navbar-menu">
                <div className="navbar-start">
                    <Link to="/" className="navbar-item">Home</Link>
                    <Link to="/dashboard" className="navbar-item">Dashboard</Link>
                    <Link to="/chat" className="navbar-item">Chat</Link>
                </div>

                <div className="navbar-end">
                    <div className="navbar-item">
                        <div className="buttons">



                        </div>
                    </div>
                </div>
            </div>
        </nav>
    )
}

export default Navbar
